    {id: "e4",title: "New Desk (Wooden)",amount: 450,date: new Date(2021, 5, 12),}
  ];

  return (
    <div>
      <h2>Let's get started!</h2>
      <div>
        <Expenses/>
      </div>
    </div>
  );
}

export default App;
